import React from "react";

const ContactPage = () => {
    return(
    <div>
        <ul>
            <li><h2>Github:</h2> https://github.com/KennyDev0213</li>
            <li><h2>Itch.IO:</h2> https://kennydev0213.itch.io/</li>
            <li><h2>Email:</h2> Kedong0213@gmail.com</li>
            <li><h2>Phone Number:</h2> 778-861-8003</li>
        </ul>
    </div>
    )
}

export default ContactPage;
